import React, { Component } from 'react';
import { connect } from 'react-redux';
import { Input, Button, Label, Row, Col } from 'antd';
class Person extends Component {
    constructor() {
        super()
        this.state = {}
    }
    render() {
        return (
            <Row gutter={8}>
                <Col md={{ span: 6 }}>
                    <h3>ค้นหาผู้ป่วย:</h3>
                </Col>

                <Col md={{ span: 6 }}>
                    <Input placeholder={"VN"} />
                </Col>

            </Row>

        )
    }
}

export default connect()(Person);
